import React from 'react';

export default function Item(props) {
  return (
    <div>
      <div className="order-items-1">Quantity</div>
      <div className="order-items-2">Item</div>
      <div className="order-items-3">Price</div>
      {props.order.map(e => (
        <div id={e.id} key={e.id} className="order-items-container">
          <div className="order-items-1">{e.qnt}</div>
          <div className="order-items-2">{e.item}</div>
          <div className="order-items-3">{e.price}</div>
        </div>
      ))}
    </div>
  );
}
